import React from 'react';

class LoginPage extends React.Component {
  render() {
    return (
      <React.Fragment>
        UsersName:
        <input />
        Psssword:
        <input />
        <br />
        <button onClick={this.login()}>Login</button>
      </React.Fragment>
    );
  }
}

export default LoginPage;
